import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";
import { useState } from 'react';

import pastEventsJson from "../../data/pastEvents.json";
import EventDetails from './EventDetails.js';

function PastEvents() {

    const [show, setShow] = useState(false);

    const eventList = pastEventsJson && pastEventsJson.map( event => {
        var strEventDetails = JSON.stringify(event.details);

        let navigate = useNavigate(); 
        const routeChange = () =>{ 
          let path = `/events/${event.urlName}`; 
          navigate(path);
        }

        return(
            <div key={event.id}>
                <Col>
                    {/* <Link
                    to={{
                        pathname: `/events/${event.urlName}`
                    }}
                    state={{
                        id: `${event.id}`,
                        urlName: `${event.urlName}`,
                        name: `${event.name}`,
                        location: `${event.location}`,
                        date: `${event.date}`,
                        image: `${event.image}`,
                        details: strEventDetails,
                    }}
                    >
                        <div className="card">
                            <img src={event.image} className="card-img" alt={event.name}/>
                            <div className="card-body">
                                <span className="copyright">{event.date}</span>
                                <span className="card-title medium">{event.name}</span>
                            </div>
                        </div>
                    </Link> */}

                    <Link href={() => false} onClick={routeChange}>
                        <div className="card">
                            <img src={event.image} className="card-img" alt={event.name}/>
                            <div className="card-body">
                                <span className="copyright">{event.date}</span>
                                <span className="card-title medium">{event.name}</span>
                            </div>
                        </div>
                    </Link>
                </Col>
            </div>
        );
    });




    return(
        <>
            <div className="row past-events">
                <div className="col">
                    <h4>Past events</h4>
                    <Row xs={1} md={4} className="g-4">
                        {eventList}
                    </Row>
                </div>
            </div>

            <div>
                    {show ? (
                        <EventDetails/>
                    ) : (
                        ""
                    )}
                </div>
        </>
    );
}

export default PastEvents;
